import { Modal } from "react-bootstrap";

function Signup(){
    return (
        <>
            <table>
                <tr>
                    <td>
                        <label>First Name:</label>
                    </td>
                    <td><input type='text' id="fname"></input></td>
                </tr>
            </table>        
        </>
    );
}

export default Signup;
